import navcss from './nav.module.css';
export default function Navbar(prop){
    const { situacao } = prop;
    return(
        <nav className={navcss.nav}>
            <h3>Menu</h3>
            <ul>
                <li>sou pessoa</li>
                <li>sou empresa</li>
                <li>instituição</li>
                <li>cookies e privacidade</li>
            </ul>
            <p className={navcss.versao}>v 1.0/11-11-2020</p>
        </nav>
    )
}
